import { Button } from '@material-ui/core'
import React from 'react'
import styled from 'styled-components';
import "./Home.css"
import Search from './Search'


const ButtonBlue = styled.button`
  font-size: 30px;
  margin: -25px;
  padding:10px;
  padding-left:50px;
  padding-right:50px;
  border-radius: 3px;
  background-color: #4183d7;
  color: #fff;
  border: none;
`;
const ButtonDeposer = styled.button`
  font-size: 30px;
  margin: -25px;
  padding:10px;
  padding-left:50px;
  padding-right:50px;
  border-radius: 3px;
  background-color: #FF6E14;
  color: #fff;
  border: none;
`;
function Home() {
    return (
        <div className="home">
            <div className="home__background">
            <h1>Avec la livraison <u>chez vous</u> tout est à portée de main !</h1>
            <h3>Trouvez la bonne affaire parmi les millions de petites annonces leboncoin</h3>
            </div>
            <Search />
            <ButtonBlue>Rechercher (39 522 102 résultats)</ButtonBlue>
            <ButtonDeposer></ButtonDeposer>

        </div>
    )
}

export default Home
